import React from "react";
import ReactDOM from "react-dom";
import { GloabalStyle } from "../src/styles/global";
import App from "./App";
import { AuthProvider } from "./hooks/AuthContext";

ReactDOM.render(
  <React.StrictMode>
    <AuthProvider>
      <App />
    </AuthProvider>

    <GloabalStyle />
  </React.StrictMode>,
  document.getElementById("root")
);
